INSERT INTO `preguntas` VALUES (1,1,'Ingrese a zona de desinfección.','EPP 5,EPP 8',1,1),(2,2,'Si su mandil es reusable, retírese y colóquelo en contenedor de lavandería.','EPP 5,EPP 8',1,1),(3,3,'Si porta visor ubíquese en una de las áreas de retiro del EPP y prepare su contenedor con la primera bolsa roja. (SINO PORTA VISOR, PASE AL ÍTEM 6)','EPP 5,EPP 8',1,1),(4,4,'Retírese la mascarilla con visor/casco de atrás hacia adelante y colóquela en el recipiente asignado. Si fuera de material desechable colocar en la bolsa roja.','EPP 5,EPP 8',1,1),(5,5,'Higienice las manos con solución alcohólica.','EPP 5,EPP 8',1,1),(6,6,'a. Rompa las tiras del cuello y del cinturón, y lleve el mandilón hacia adelante, no toque la parte delantera.<br>\n                    b. Retire cada manga junto con el guante externo.<br>\n                    c. Enrolle hacia adelante cogiéndolo por la parte interna hasta tener un paquete.<br>\n                    d. Deseche todo en el contenedor sin generar aerosoles.','EPP 8',2,1),(7,7,'a. Lleve la cabeza hacia atrás, y habrá el cierre del mameluco (NO TOQUE LA PIEL).<br>\n                b.	Quítese la capucha del mameluco cogiendo desde la parte trasera (SIN TOCAR LA PARTE INTERNA).<br>\n                c.	Quítese el mameluco desde arriba, retire un hombro cogiendo y jalando hacia afuera la parte externa con una mano, luego retire el otro hombro, deslice hasta debajo de los codos, llévelos hacia adelante y retire manga por manga junto con el segundo par de guantes, enrollando y cogiendo por la parte interna, hasta llegar a la altura de las pantorrillas.<br>\n                d.	Tome asiento en una silla y retire las mangas de las piernas con los zapatos y los cubre calzados de cada miembro inferior, siga enrollando, cogiendo por la parte interna hasta tener un paquete.<br>\n                e.	Retire y coloque el paquete dentro de la bolsa roja.','EPP 8',3,1),(8,8,'Higienice las manos con solución alcohólica.','EPP 5,EPP 8',3,1),(9,9,'Retire las botas de tela o botas descartables.','EPP 5,EPP 8',3,1),(10,10,'Higienice las manos con solución alcohólica.','EPP 5,EPP 8',3,1),(11,11,'Retire el gorro quirúrgico y deséchelo en el contenedor sin generar aerosoles.','EPP 5,EPP 8',3,1),(12,12,'Higienice las manos con solución alcohólica.','EPP 5,EPP 8',3,1),(13,13,'a.  Aplique hipoclorito de sodio al 1% al interior de la bolsa.<br>\n                b.	Cierre la bolsa roja enrollado los bordes y haciendo un nudo técnica caramelo. <br>\n                c.	Aplique hipoclorito de sodio al 1% al exterior de la bolsa. <br>\n                d.	Coloque la bolsa roja en el contenedor principal de la sala.','EPP 8',4,1),(14,14,'Higienice las manos con solución alcohólica.','EPP 5,EPP 8',4,1),(15,15,'Si usa lentes de protección, retírelos, cogiéndolos de los brazos o la parte posterior del elástico (según modelo) y colóquelo en la mesa destinada sobre toalla de papel.','EPP 5,EPP 8',4,1),(16,16,'Higienice las manos con solución alcohólica.','EPP 5,EPP 8',4,1),(17,17,'a. Jale el elástico /en caso de ELASTOMÉRICO, desconecte el engrape postero-inferior del respirador y llévelo hacia adelante de la cabeza y déjelo colgando; luego retire el correspondiente de la parte superior llevándolo hacia adelante y colóquelo en la mesa destinada sobre toalla de papel.<br>\n                b.	Si es respirador desechable:<br>\n                ?	Sujete el elástico postero-inferior del respirador y llévelo hacia adelante de la cabeza y déjelo colgando; luego retire el correspondiente de la parte superior llevándolo hacia adelante.<br>\n                ?	Se colocará en una bolsa de papel. Ciérrela y no maltrate el respirador.','EPP 5,EPP 8',5,1),(18,18,'El celador le colocará una mascarilla quirúrgica.','EPP 5,EPP 8',5,1),(19,19,'Retire los guantes con la técnica apropiada y colóquese unos guantes nuevos.','EPP 5,EPP 8',5,1),(20,20,'Diríjase a la puerta de salida e introduzca sus botas o zapatos en el contenedor de desinfección de calzado, el celador puede rociar las caña de las botas.','EPP 5,EPP 8',5,1),(21,21,'Si tiene respirador elastomérico y lentes reusables, llévelos en toalla de papel hacia la zona donde se encuentran las mesas individuales para limpieza y desinfección de respiradores.<br>\n                Si tiene respirador N95 en su bolsa de papel, llévelo a su zona de almacén en ambiente ventilado, No pegue las bolsas de papel entre sí.','EPP 5,EPP 8',5,1),(22,22,'a.  Use guantes y mascarilla quirúrgica.<br>\n                b.	Coja la carcasa por los bordes, con la zona de engranaje hacia arriba. La cara externa del filtro debe mirar hacia abajo.<br>\n                c.	Limpiar los filtros de manera superficial.<br>\n                d.	Con una hoja de papel toalla embebida en alcohol Isopropílico (solución desinfectante) limpie la carcasa desde la zona menos contaminada a la zona más contaminada,<br>\n                e.	No toque la parte interna del filtro ni el engranaje.<br>\n                f.	Repita con la otra carcasa o cápsula.<br>\n                g.	Colóquelas en una bolsa de plástico.','EPP 5,EPP 8',6,1),(23,23,'Higienice las manos con solución alcohólica.','EPP 5,EPP 8',6,1),(24,24,'Limpieza provisional<br>\n                a.	Use guantes y mascarilla quirúrgica.<br>\n                b.	Separe los filtros de la máscara elastomerica colocando la cara externa del filtro mirando hacia abajo.<br>  \n                c.	Con una hoja de papel toalla embebida en DETERGENTE ENZIMATICO limpie la máscara y el arnés desde la zona menos contaminada a la zona más contaminada hasta que esté visiblemente húmedo, deje 1 minuto.<br>\n                d.	Elimine el DETERGENTE residual con un papel toalla humedecido en agua y seque al aire o seque a mano antes del siguiente uso en una zona no contaminada.<br>\n                e.	Con una una hoja de papel toalla embebida en ALCOHOL ISOPROPILICO limpie la máscara (REPITE ITEM C).<br>\n                f.	REPETIR ITEM ?D? para eliminar todos los residuos.<br>\n                g.	Inspeccione y vuelva a armar el respirador.<br>\n                h.	Colóquela en una bolsa de plástico.','EPP 5,EPP 8',7,1),(25,25,'Lave sus manos con la técnica apropiada.','EPP 5,EPP 8',7,1),(26,26,'Se dirige a las duchas para tomar un baño.','EPP 5,EPP 8',7,1);
/*!40000 ALTER TABLE `preguntas` ENABLE KEYS */;
